    public function log_it( $short, $long="", $payload="", $user_id=null, $company_id=null, $company_parent_id=null)
    {
        if ( getStringValue($user_id) == "" ) $user_id = GetSessionValue("user_id");
        if ( getStringValue($company_id) == "" ) $company_id = GetSessionValue("company_id");
        if ( getStringValue($company_parent_id) == "" ) $company_parent_id = GetSessionValue("companyparent_id");
        $short = getStringValue($short);
        $long = getStringValue($long);
        $payload = json_encode($payload, true);

        // Grab the session, if we are not running CLI.
        $session = "{}";
        if ( isset( $_SESSION) ) $session = json_encode($_SESSION);

        // If this is a CLI request, try and grab that information off of
        // the payload.
        if ( $this->input->is_cli_request() && is_array($payload) ) {
            $user_id = getArrayStringValue("user_id", $payload);
            if ( getStringValue($company_id) == "" ) $company_id = getArrayStringValue("company_id", $payload);
            $company_parent_id = getArrayStringValue("company_parent_id", $payload);
        }


        $file = "database/sql/log/AddNewLog.sql";
        $vars = array(
            (getIntValue($user_id) == "" ? null : getIntValue($user_id))
        ,(getStringValue($session) == "" ? "" : getStringValue($session))
        ,(getStringValue($short) == "" ? null : getStringValue($short))
        ,(getStringValue($long) == "" ? null : getStringValue($long))
        ,(getStringValue($payload) == "" ? null : getStringValue($payload))
        ,(getStringValue($company_id) == "" ? null : getIntValue($company_id))
        ,(getStringValue($company_parent_id) == "" ? null : getIntValue($company_parent_id))

        );
        ExecuteSQL( $this->db, $file, $vars );
    }
    public function audit_it($desc, $payload, $user_id=null, $company_id=null, $company_parent_id=null)
    {
        if ( getStringValue($user_id) === '' ) $user_id = GetSessionValue("user_id");
        if ( getStringValue($company_id) === '' ) $company_id = GetSessionValue("company_id");
        if ( getStringValue($company_parent_id) == '' ) $company_parent_id = GetSessionValue("companyparent_id");
        $desc = getStringValue($desc);

        // Encrypt the values in the payload, then turn them into a JSON string.
        $encryption_key = A2PGetEncryptionKey();
        if ( is_array($payload) )
        {
            foreach($payload as $key=>$value)
            {
                $value = A2PEncryptString($value, $encryption_key);
                $payload[$key] = $value;
            }
        }
        $payload = json_encode($payload);

        $file = "database/sql/log/AddNewAuditRecord.sql";
        $vars = array(
            (getIntValue($user_id) == "" ? null : getIntValue($user_id))
        ,(getIntValue($company_parent_id) == "" ? null : getIntValue($company_parent_id))
        ,(getIntValue($company_id) == "" ? null : getIntValue($company_id))
        ,(getStringValue($desc) == "" ? null : getStringValue($desc))
        ,(getStringValue($payload) == "" ? null : getStringValue($payload))
        );
        ExecuteSQL( $this->db, $file, $vars );
    }
